script: |
  super -f text -I q2816.spq | sort > q2816.out

inputs:
  - name: q2816.spq
    data: |
      SELECT DISTINCT - - col0 FROM tab1 (FORMAT parquet) WHERE NOT - 87 + + col0 / 38 * - 62 * + col0 * + col2 NOT BETWEEN - 57 - + col1 AND - col2;
  - name: tab1

outputs:
  - name: q2816.out
    data: |
